import EditServices from "./EditServices"
import EditAbout from "./EditAbout"

import "./EditText.css"

const EditText = () => {
    return (
        <div>
                <div className='CenterSection'>
                    <EditAbout />
                    <EditServices />
            </div>
        </div>
    );
};

export default EditText;
